import React from 'react';

class Partida extends React.Component{
    render(){
        return(
            <div>
                <h2>Estadio</h2>
                <div>
                    <span>{this.props.estadio}</span>
                    <span> {this.props.data}</span>
                    <span>{this.props.horario}</span>
                </div>
                
            </div>
        )
    }

}

export default Partida;
